import ReactDOM from 'react-dom'
import { useState, useEffect } from 'react';
import MyComponent from "./count";


function UrlCount(){
    return(
      <div className='count'>
        <MyComponent/>
      </div>
    )
  }

  function Error(){

    const [error, setError]= useState('')

  const fetchInfo = () => {
  return fetch("/index")
  .then ((res) => res.json())
  .then((d) => setError(d))
}

useEffect(() => {
  fetchInfo();
});

    return(
      <div className='p-1 '>
        {error}
      </div>
    )
  }

  document.addEventListener('DOMContentLoaded', () => {
    ReactDOM.render(
      <Error/>,
      // document.getElementById('error')
    )
    })

  document.addEventListener('DOMContentLoaded', () => {
    ReactDOM.render(
      <UrlCount/>,
      document.getElementById('count')
    )
    })
